def test_gbk_parsing_and_flatfile_for_neo4j_creation_collect_tables_in_memory_true():
    temp_dir = tempfile.TemporaryDirectory()
    export_tables(
        sequence_files_glob=gbk_files,
        outdir=temp_dir.name,
        n_fasta_splits=1,
        collect_tables_in_memory=True,
    )

    files = [i.name for i in Path(temp_dir.name).iterdir()]
    files.sort()
    assert files == [
        "assembly",
        "assembly_to_locus",
        "assembly_to_taxid",
        "fasta_split_1.faa",
        "loci",
        "locus_to_protein",
        "protein_info",
    ]
    file_dict = {i: None for i in files}
    for filename in files:
        with open(Path(temp_dir.name, filename), "r") as h:
            file_dict[filename] = h.readlines()
    assert file_dict == expected_file_dict


def test_gbk_parsing_and_flatfile_for_neo4j_creation_collect_tables_in_memory_false():
    temp_dir = tempfile.TemporaryDirectory()
    export_tables(
        sequence_files_glob=gbk_files,
        outdir=temp_dir.name,
        n_fasta_splits=1,
        collect_tables_in_memory=False,
    )

    files = [i.name for i in Path(temp_dir.name).iterdir()]
    files.sort()
    assert files == [
        "assembly",
        "assembly_to_locus",
        "assembly_to_taxid",
        "fasta_split_1.faa",
        "loci",
        "locus_to_protein",
        "protein_info",
    ]
    file_dict = {i: None for i in files}
    for filename in files:
        with open(Path(temp_dir.name, filename), "r") as h:
            file_dict[filename] = h.readlines()
    assert file_dict == expected_file_dict
